            [KOMOKU_FEE, "000", "BANK FEE", null, null, null, null, null, null],
            [KOMOKU_FEE, "001", "BANK FEE", "1-Bên B chịu", "- Tất cả phí chuyển khoản ngân hàng sẽ do bên B chịu ( điều này có nghĩa là Bên A sẽ nhận đúng số tiền trên hóa đơn).\r\n All Bank transfer fees will be paid by party B (it means that Party A must receive the Full amount of  VAT Invoice)", null, null, null, null],
            [KOMOKU_FEE, "002", "BANK FEE", "2-Từng bên chịu", "- Phí chuyển khoản ngân hàng của bên nào thì bên đó chịu\r\n The bank transfer fee of each party will be born by that party", null, null, null, null],
            [KOMOKU_FEE, "003", "BANK FEE", "3-Bên A chịu", "- Phí chuyển khoản ngân hàng sẽ do bên A chịu\r\n The bank transfer fee of the party will be born by party A", null, null, null, null],
            [KOMOKU_FEE, "004", "BANK FEE", "4-(HANOI)Phí thông quan...", "- Phí thông quan xuất, phí vận chuyển, phí chứng từ và các phí khác phát sinh từ Bên A (nếu có) sẽ do Bên B chịu.\r\nBên A sẽ trả các phí trên tại thời điểm phát sinh thay Bên B, sau đó Bên A sẽ phát hành công nợ cho Bên B.\r\nBên B sẽ trả đầy đủ cho bên A vào ngày 20 của tháng sau. ; \r\n- Export custom clearance fees, transportation fees, documentation fees and other fees of Party A (if any) whose fees shall\r\nbe borne by Party B.\r\nParty A pay the above fees for party B at the accrued time and then the Party A will issue a debit note to Party B.\r\nParty B will pay in full to the Party A on 20th the following next month.", null, null, null, null],
